	fileg := &embedded.EmbeddedFile{
		Filename:    "static/js/components/button.js",
		FileModTime: time.Unix(1561064869, 0),
		Content:     string("var Button = {\r\n    template: `<button class=\"btn sw-button\" v-bind:class=\"{'btn-success':state, 'btn-primary':inverted_state}\" v-on:click=\"setPort()\" @contextmenu=\"clickHandler($event)\">\r\n                    {{label}}\r\n                </button>`,\r\n    props: {\r\n        label: String,\r\n        state: Boolean,\r\n        port: String,\r\n    },\r\n    mounted: function(){},\r\n    beforeDestroy: function(){},\r\n    methods: {\r\n        // handle right clicks\r\n        clickHandler: function(e){\r\n            this.$emit(\"set-port-exclusive\", this.port, this.label)\r\n            // omit standard right click menu\r\n            e.preventDefault();\r\n        },\r\n        setPort: function(){\r\n            this.$emit(\"set-port\", this.port, this.label, !this.state)\r\n        },\r\n    },\r\n    watch: {},\r\n    computed: {\r\n        inverted_state: function(){\r\n            return !this.state;\r\n        }\r\n    }\r\n}"),
	}
	fileh := &embedded.EmbeddedFile{
		Filename:    "static/js/components/device-name.js",
		FileModTime: time.Unix(1561064869, 0),
		Content:     string("var DeviceName = {\r\n    template: '<div class=\"device-name\" :style=\"styleObj\"><div class=\"tag\">{{typeLabel}}</div><div class=\"name\">{{name}}</div></div>',\r\n    props: {\r\n        name: String,\r\n        width: Number,\r\n    },\r\n    mounted: function () {},\r\n    beforeDestroy: function () {},\r\n    methods: {},\r\n    computed: {\r\n        typeLabel: function () {\r\n            return \"SW\"\r\n        },\r\n        styleObj: function() {\r\n            return {\r\n                \"max-width\": this.width + 'px',\r\n                \"font-size\": this.width / 15 + \"pt\",\r\n            }\r\n        }\r\n    },\r\n    watch: {},\r\n}"),
	}
	filei := &embedded.EmbeddedFile{
		Filename:    "static/js/components/switch.js",
		FileModTime: time.Unix(1561064869, 0),
		Content:     string("var Switch = {\r\n    components: {\r\n        'swbutton': Button,\r\n        'device-name': DeviceName,\r\n    },\r\n    template: `\r\n        <div class=\"switch\">\r\n            <device-name :name=\"name\"></device-name>\r\n            <div v-for=\"port in ports\">\r\n            <div class=\"port\"> Port {{port.name}}\r\n                <div class=\"btn-group\" role=\"group\" aria-label=\"...\" v-for=\"terminal in port.terminals\">\r\n                <swbutton :label=\"terminal.name\" :port=\"port.name\" :state=\"terminal.state\" v-on:set-port=\"setPort\" v-on:set-port-exclusive=\"setPortExclusive\">\r\n                </swbutton>\r\n                </div>\r\n            </div>\r\n            </div>\r\n        </div>`,\r\n    props: {\r\n        name: String,\r\n        ports: Array,\r\n    },\r\n    mounted: function () { },\r\n    beforeDestroy: function () { },\r\n    methods: {\r\n        // set one terminal of a port\r\n        setPort: function (portName, terminalName, terminalState) {\r\n\r\n            this.$emit(\"set-port\", this.name, portName, terminalName, terminalState)\r\n        },\r\n        // disable all terminals, except of the selected one\r\n        setPortExclusive: function (portName, terminalName) {\r\n            var port = undefined;\r\n            var terminals = [];\r\n\r\n            for (var i = 0; i < this.ports.length; i++) {\r\n                if (this.ports[i].name == portName) {\r\n                    port = this.ports[i]\r\n                }\r\n            }\r\n\r\n            for (var i = 0; i < port.terminals.length; i++) {\r\n                var terminal = {\r\n                    name: port.terminals[i].name,\r\n                    state: false,\r\n                }\r\n                if (terminal.name == terminalName){\r\n                    terminal.state = true\r\n                }\r\n                terminals.push(terminal)\r\n            }\r\n            this.$emit(\"set-ports\", this.name, portName, terminals)\r\n\r\n        },\r\n    },\r\n    watch: {},\r\n}"),
	}
